import React from 'react'
import { Header } from "./../../components/header";
import { Card } from '../../components/card';
import { Container } from './styles';

const Feed = () => {
  return (
    <>
    <Header />
    <Container>
        <Card/> 
        <UserInfo name="Eduardo Ngoca" image="./logo.webp" percentual="80"/> 
    </Container>
  </>
  )
}

export {Feed}
